css:
html,
body,
.tree-view,
.tab-bar .tab .editor {
  font-weight: bold;
}
html,
body,
.tree-view,
.tab-bar .tab {
  font-family: Roboto;
  font-size: 11px;
}
.tree-view .list-group li:not(.list-nested-item),
.tree-view .list-tree li:not(.list-nested-item),
.tree-view .list-group li.list-nested-item > .list-item,
.tree-view .list-tree li.list-nested-item > .list-item {
  line-height: 24px;
}
.tree-view .list-group .selected:before,
.tree-view .list-tree .selected:before {
  height: 24px;
}
.line,
.line-number,
.cursor {
  line-height: 1.5;
}
